import filesize from "~/utils/filesize";
import {computed, inject} from "vue";
import MenuItem from "./MenuItem.vue";

const userStore = useUserStore();
const { userUsage, activeSubscription } = storeToRefs(userStore)
const { updateUser, userLogout } = userStore
const walletsStore = useWalletsStore()
const { offline } = storeToRefs(walletsStore)
const { lockWallets } = walletsStore

const emitter = inject('emitter') as any

const route=useRoute();
const path = computed(() =>route.path)
console.log(path.value)

const currentUserUsage = computed(() => {
  if (!activeSubscription.value?.plan_code) return 'No subscription';
  return userUsage && userUsage.value && (userUsage.value as any).customer_usage ? filesize((userUsage.value as any).customer_usage.charges_usage[0].units) : '';
});

const currentUserUsagePercentageToPaggingRight = computed(() => {
  const planCode = activeSubscription.value.plan_code;
  if (userUsage && userUsage.value && (userUsage.value as any).customer_usage) {
    if (planCode.startsWith('TRIAL'))
      return 100 - parseInt((userUsage.value as any).customer_usage.charges_usage[0].units) / (CONFIG.TRIAL_PLAN_LIMIT * 1024 * 1024) * 100;
    if (planCode.startsWith('MEDIUM'))
      return 100 - parseInt((userUsage.value as any).customer_usage.charges_usage[0].units) / (CONFIG.MEDIUM_PLAN_LIMIT * 1024 * 1024) * 100;
    if (planCode.startsWith('LARGE'))
      return 100 - parseInt((userUsage.value as any).customer_usage.charges_usage[0].units) / (CONFIG.LARGE_PLAN_LIMIT * 1024 * 1024) * 100;
  }
  return 100;
});

const stageColor = computed(() => {
  const percentageUsage = 100 - currentUserUsagePercentageToPaggingRight.value;
  if (percentageUsage < 33)
    return 'bg-green-300';
  else if (percentageUsage < 66)
    return 'bg-yellow-100';
  else
    return 'bg-rose-300';
})

const planLimit = computed(() => {
  const planCode = activeSubscription.value.plan_code;
  if (planCode.startsWith('TRIAL')) {
    return filesize(CONFIG.TRIAL_PLAN_LIMIT * 1024 * 1024);
  } else if (planCode.startsWith('MEDIUM')) {
    return filesize(CONFIG.MEDIUM_PLAN_LIMIT * 1024 * 1024);
  } else if (planCode.startsWith('LARGE')) {
    return filesize(CONFIG.LARGE_PLAN_LIMIT * 1024 * 1024);
  }
  return '0 TB';
});

const logout = async () => {
  await userLogout();
}
</script>

